import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom"

export default function My_Manager(props) {
    const [mystyle, setMystyle] = useState({});
    useEffect(() => {
        setMystyle({
            color: "#3aedff",
            fontSize: "20px", marginLeft: "330px",
            marginTop: "70PX"
        });
    }, []);
    return (<div>
        <div>
            <nav id="navs">
                <Link className="link" style={mystyle} to={`/manager/productlist`}>productlist</Link>
                <Link className="link" style={mystyle} to={`/manager/addProduct`}>addProduct</Link>
                <Link className="link" style={mystyle} to={`orderingList`}>orderingList</Link>
                <Link className="link" style={mystyle} to={`profits`}>profits</Link>
            </nav>
            <Outlet />
        </div>
    </div>);
}
